module.exports="#define GLSLIFY 1
varying vec2 vUv;
uniform float uTime;

void main() {
  vUv = uv;

  float time = uTime * 1.0;

  vec3 transformed = position;
  transformed.z += sin(position.x + time);

  gl_Position = projectionMatrix * modelViewMatrix * vec4(transformed, 3.);
}

";
